import React, { Component } from 'react';
import { Link, BrowserRouter as Router, Route, Switch, withRouter } from 'react-router-dom'

class Login extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div class="skin-default card-no-border" cz-shortcut-listen="true">
                {/* ============================================================== */}
                {/* Preloader - style you can find in spinners.css */}
                {/* ============================================================== */}
                <div className="preloader" style={{ display: 'none' }}>
                    <div className="loader">
                        <div className="loader__figure" />
                        <p className="loader__label">Elegant admin</p>
                    </div>
                </div>
                {/* ============================================================== */}
                {/* Main wrapper - style you can find in pages.scss */}
                {/* ============================================================== */}
                <section id="wrapper">
                    <div className="login-register">
                        <div className="login-box card">
                            <div className="card-body">
                                <form className="form-horizontal form-material" id="loginform">
                                    <h3 className="box-title m-b-20">Sign In</h3>
                                    <div className="form-group ">
                                        <div className="col-xs-12">
                                            <input className="form-control" type="text" placeholder="Username" /> </div>
                                    </div>
                                    <div className="form-group">
                                        <div className="col-xs-12">
                                            <input className="form-control" type="password" required placeholder="Password" /> </div>
                                    </div>
                                    <div className="form-group row">
                                        <div className="col-md-12">
                                            <div className="custom-control custom-checkbox">
                                                <input type="checkbox" className="custom-control-input" id="customCheck1" />
                                                <a href="javascript:void(0)" id="to-recover" className="text-dark float-right"></a>
                                            </div>
                                        </div>
                                    </div>
                                    <Link to='/Dashbord'>
                                        <div className="form-group text-center">
                                            <div className="col-xs-12 p-b-20">
                                                <button className="btn btn-block btn-lg btn-info btn-rounded" type="button">Log In</button>
                                            </div>
                                        </div>
                                    </Link>
                                </form>
                            </div>
                        </div>
                    </div>
                </section>
                {/* ============================================================== */}
                {/* End Wrapper */}
                {/* ============================================================== */}
                {/* ============================================================== */}
                {/* All Jquery */}
                {/* ============================================================== */}
                {/* Bootstrap tether Core JavaScript */}
                {/*Custom JavaScript */}
            </div>
        );
    }
}

export default Login;
